var tipuesearch = {"pages": [{'title': '首頁', 'text': '小組組員:40823204 40823220 40823228 40823242 \n 個人倉儲: https://github.com/40823228/cd2021 \n 二人小組網站: https://40823228.github.io/stage1-bg14/content/index.html \n 四人小組網站: https://40823204.github.io/stage2-bg14/content/index.html \n 八人小組倉儲: https://github.com/40823221/stage3-bg5 \n 二人小組倉儲: https://github.com/40823228/stage1-bg14 \n 四人小組倉儲: https://40823204.github.io/stage2-bg14/content/index.html \n 八人小組倉儲: https://40823221.github.io/stage3-bg5/content/index.html \n', 'tags': '', 'url': '首頁.html'}, {'title': '每周進度', 'text': '分工:40823228(成品零件繪製、模擬，報告影片) \n \xa0 \xa0 \xa0 \xa0\xa0 40823242(初稿零件繪製、模擬，報告影片) \n 進度表:W1 架設網站 討論主題 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0W2 初稿完成 修改並討論 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0W3 油壓升降平台 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0W4 報告和彩現圖 \n', 'tags': '', 'url': '每周進度.html'}, {'title': '專題動機', 'text': '在工地裡,經常需要在高處實施作業,可是目前在外面看到的作業平台都是用組裝式的,不僅延長工作時間,在搭建過程,也有極大的掉落風險,所以我們小組設計出”油壓式升降平台”,不僅方便攜帶,也大幅減少風險與搭建平台的作業時間。 \n 拆卸式鷹架(一) 拆卸式 鷹架(二) \n 圖片資料來源 \n', 'tags': '', 'url': '專題動機.html'}, {'title': 'W1 架設網站 討論主題', 'text': '3/3第一次討論 \n \n 因為第一次討論主題與他組雷同，故修改為"升降平台" \n 3/5第二次討論 \n \n 3/10第三次討論 \n 經過討論與參考相關資料後 繪製出"升降平台"初稿 \n \n', 'tags': '', 'url': 'W1 架設網站 討論主題.html'}, {'title': 'W2 初稿完成並討論', 'text': '升降平台初稿模擬影片 使用SolidWorks2017繪製  檔案下載 \n \n \n 等角圖 \n 前視圖 右視圖 \n 討論:在畫完小組專題”升降平台”之後,發現初稿的作動方式,好像有點單調,經過小組的討論之後,想了其他幾種作動方式,例如: 油壓式、齒輪式、皮帶輪式等等,而我們最終選擇油壓式,因為油壓可以提供非常大的力量,不僅承重能力提升,也使此裝置更為安全 ! \n', 'tags': '', 'url': 'W2 初稿完成並討論.html'}, {'title': 'W3 油壓升降平台', 'text': '油壓升降平台模擬影片 使用SolidWorks2017繪製  檔案下載 \n \n \n 前視圖 \n \n 右視圖 \n \n 上視圖 \n 討論:經過初稿模擬測試之後,在這次的版本,使用了油壓式的作動方式,解決了在初稿略顯單調且裝置不安全的問題 ! \n', 'tags': '', 'url': 'W3 油壓升降平台.html'}, {'title': 'W4 報告和彩現圖', 'text': '專題題目 : 升降平台\xa0 使用SolidWorks2017繪製\xa0 檔案下載 \n 影片報告: \n 彩現圖: \n \n \n \n \n \n', 'tags': '', 'url': 'W4 報告和彩現圖.html'}, {'title': '心得和PDF檔案', 'text': '心得: \n 這次的協同產品設計的前四周是採取二人分組，因為剛接觸協同產品設計，所以在各項作業上都有一定的陌生，不過隨著討論次數的增加，也越來越上手，這次的分組專題讓我體會到如果用傳統的開會討論，肯定會耗費更多的時間，所以接下來的四人小組、八人小組，如果工作分配得宜的話，一定可以創造更有價值性的產品。 \n PDF檔案下載 \n \n', 'tags': '', 'url': '心得和PDF檔案.html'}, {'title': '課程筆記', 'text': '\n', 'tags': '', 'url': '課程筆記.html'}, {'title': '問題', 'text': '', 'tags': '', 'url': '問題.html'}, {'title': '缺少Python.exe (3.9.1) 啟動時所對應呼叫的特定 Windows 系統 dll 檔案(正在嘗試解決)', 'text': 'Python.exe (3.9.1) 啟動時所對應呼叫的特定 Windows 系統 dll 檔案, 無法正確連結, 但具體原因或處理方法可能要再深入查找 \n', 'tags': '', 'url': '缺少Python.exe (3.9.1) 啟動時所對應呼叫的特定 Windows 系統 dll 檔案(正在嘗試解決).html'}, {'title': 'CMSIMDE版本錯誤', 'text': '進入倉儲 => Fork \n \n 會出現 \n \n 之後進入C的tmp底下 git clone -- recurse-submodule 網址 .git 3202 \n \n 然後到隨身碟C槽底下，確認是否clone完成 \n \n 完成之後，因為cmsimde目前是錯誤的版本，所以必須知道最新的版次號，進入老師的倉儲 \n \n 找到最近一次cmsimde的版本 \n \n 複製版次號的前7瑪 \n \n 進入cmsimde \n \n 卻發現是空的 \n \n 開啟黑窗 進入3202的cmsimde裡面 git checkout 版次碼前7碼 \n 之後就推送上 去 \n \n 進入倉儲 => pull request \n \n 進入之後要推送資料 \n \n 出現 \n \n 完成新增 正確版本cmsimde的pull request，之後只要上去抓下來即可 \n \n', 'tags': '', 'url': 'CMSIMDE版本錯誤.html'}, {'title': '四人小組 每周進度', 'text': '', 'tags': '', 'url': '四人小組 每周進度.html'}, {'title': 'W5 各組影片報告長度', 'text': '\n 載入中… \n  小組報告 \n', 'tags': '', 'url': 'W5 各組影片報告長度.html'}, {'title': 'W6 四人小組討論', 'text': '\n \n 討論結果 : 省力搬運機 \n 動機: 在工地裡，經常需要用到台車搬運東西，例如裝著水泥的箱子，如果 是要靠人力搬運的話，不僅會造成工作效率的減少，也會使搬運人員 的體力大量消耗，所以討論過後，我們小組決定設計”省力搬運機”， 不僅解決搬運問題，也大幅地提高工作效率與人員體力的損耗。 \n \n 參考影片來源 \n', 'tags': '', 'url': 'W6 四人小組討論.html'}, {'title': 'W7 省力搬運機構', 'text': '搬運機.zip \xa0零件下載\xa0\xa0使用inventer2018繪製 \n SolidWorks 模擬影片 \n \n cns 150-A-2.2 \n \n CNS 3121-M2x12 \n \n CNS 3121-M2x12-2 \n \n CNS 3128-M2x0.4 \n \n 支架 \n \n 底桿 \n \n 後輪架 \n \n 側邊桿一號 \n \n 側邊桿二號 \n 側邊桿三號 \n \n 側邊桿四號 \n \n 連接桿 \n \n 握桿 \n \n 普力桶 \n \n 鉚釘 \n \n 輪子 \n \n 輪子架 \n \n', 'tags': '', 'url': 'W7 省力搬運機構.html'}, {'title': 'W8 程式模擬', 'text': 'CoppliaSim 4.0 模擬 \n \n 問題:因使用CoppeliaSim模擬時，發現我們組合圖使用太多零件組合，導致爆炸後有70多個零件，我們已經盡力模擬，但零件太多很難察覺是哪個環節出現錯誤，所以小組討論後決定使用Inventor和solidworks進行模擬。 \n SolidWorks 2017 模擬 \n \n 問題: 因為使用 CoppliaSim 模擬時，可能因為對程式不熟悉， 導致模擬失敗後，討論決定使用 SolidWorks 模擬之後，完成 省力搬運機模擬。 \n Inventor 2018 模擬 \n \n 問題: 這此不僅使用了 CoppliaSim 和 SolidWorks 進行模擬， 還用了 Inventor 進行模擬，不僅更完整演示本組專題，作動 方式與功能，更能體會到在不同軟體模擬可能出現的狀況。 \n 使用 CoppeliaSim4.0 SolidWorks2017 Inventor 2018 模擬 \n', 'tags': '', 'url': 'W8 程式模擬.html'}, {'title': 'W9 個人心得', 'text': '本次的專題，是採取四人小組，較上次的兩人小組多了兩個 人，而此次的專題製作過程，讓我體會到四人小組較以往二 人小組的差別，過程中有好有壞，優點是做起事來，不僅更 加快速，能做的事情也更多了，而且遇到問題時，大家可以 互相討論，每個人的想法不同，也能看到更多不一樣的東西， 而缺點就是，因為組員增加了，所以在網站的維護方面，也 比較困難，所以小組必須要常常進行討論且共同維護網站， 接下來要進去八人小組，若工作分配得宜的話，肯定可以創 造更好的專題。 \n', 'tags': '', 'url': 'W9 個人心得.html'}, {'title': '應力分析', 'text': '\n 這次不僅做了省力搬運機的作動模擬影片，還增加了該機構 主要承受力處零件的分析，由於此機構是在工地使用，為了 不造成工安意外或者是工具設計不良上導致種種問題，所以 應力分析固然重要。 \n \n 使用 Inventor 2018 進行分析 \n \n', 'tags': '', 'url': '應力分析.html'}, {'title': '小組報告', 'text': 'PDF 檔案下載 \n \n', 'tags': '', 'url': '小組報告.html'}, {'title': '八人小組 每周進度', 'text': '', 'tags': '', 'url': '八人小組 每周進度.html'}, {'title': 'W10 新增stage1、2工作分配', 'text': '', 'tags': '', 'url': 'W10 新增stage1、2工作分配.html'}, {'title': 'stage1', 'text': 'bg14 \n 專題主題: 升降平台 \n 組員/分工: \n 40823228/成品零件繪製、模擬、報告影片 \n 40823242/初稿零件繪製、模擬、報告影片 \n \n 主題簡述: \n 在工地裡，經常需要在高處實施作業，可是 目前在外面看到的作業平台都是用組裝式 的，不僅延長工作時間，在搭建過程，也有 極大的掉落風險，所以我們小組設計出”油 壓式升降平台”，不僅方便攜帶，也大幅減 少風險與搭建平台的作業時間。 \n - \n bg24 \n 專題主題:升降裝置 \n 組員/分工: \n 40823204/CoppeliaSim 測試、分組網站、PDF 製 作、reveal 簡報 \n 40823220/繪圖(Inventor)、reveal 簡報 \n \n 主題簡述: \n 方便搬運重物：大型可用來載人、小型可用在各 種自動化機械。 \n - \n bg16 \n 專題主題:氣動馬達 \n 組員/分工: \n 40823221/ Coppelia模擬、PDF製作、合併倉儲及網站 \n 40823237/ 繪製圖檔、reveal製作、倉儲推送及維護 \n \n 主題簡述: \n 因為對汽車作動原理有些許興趣，所以以引擎 的活塞與皮帶輪關係做變化。 \n', 'tags': '', 'url': 'stage1.html'}, {'title': 'stage2', 'text': 'bg12 \n 專題主題: 自動門 開門機構 \n 組員/分工: \n 40823221/ 網頁編輯、程式模擬、PDF簡報製作 \n 40823237/ 繪製圖檔、程式模擬、Reveal製作 \n 40823250/ 繪製圖檔、網頁編輯 \n 40832244/ 網頁編輯 \n 主題簡述: \n 剛開始會想做項專題的原因是因為在去 年發生了全世界的病毒感染，所以我們 想過類似門或是其他需要人體接觸的地 方盡量能讓人不用用手碰觸。 後來會做此設計也有對接觸做設計，所 以我們將感應器裝在門的周圍，是他可 以自動開啟。 \n - \n bg14 \n 專題主題: 省力搬運機 \n 組員/分工: \n 40823204/SolidWorks 零件繪製、模擬、報告影片 \n 40823205/Inventor 零件繪製、模擬、報告影片 \n 40823220/ Inventor 零件繪製、模擬、報告影片 \n 40832228/ PDF 製作、模擬、報告影片 \n 40823242/應力分析、模擬、報告影片 \n 主題簡述: \n 在工地裡,經常需要用到台車搬運東西,例如裝著水泥的箱子,如果是要靠人力搬運的話,不僅會造成工作效率的減少,也會使搬運人員的體力大量消耗,所以討論過後,我們小組決定設計”省力搬運機”,不僅解決搬運問題,也大幅地提高工作效率與人員體力的損耗。 \n', 'tags': '', 'url': 'stage2.html'}, {'title': 'W11 直播影片', 'text': 'stage3-bg5-40823220 40823250 主題:Task2、ipv4講解、作品的圖檔進度及講解和參考資料 20號:圖檔說明 50號:ipv4講解 影片: \n', 'tags': '', 'url': 'W11 直播影片.html'}, {'title': 'W12 直播影片', 'text': 'stage3-bg5 40823205、40823228 主題 : 解決CMSIMDE版本錯誤 \n 影片: \n', 'tags': '', 'url': 'W12 直播影片.html'}, {'title': 'W13 機械手臂控制、程式控制攀爬機', 'text': '模擬影片: \n', 'tags': '', 'url': 'W13 機械手臂控制、程式控制攀爬機.html'}, {'title': 'W14 機械手臂控制', 'text': '', 'tags': '', 'url': 'W14 機械手臂控制.html'}, {'title': 'Task1', 'text': '模擬影片: \n', 'tags': '', 'url': 'Task1.html'}, {'title': 'Task2', 'text': '模擬影片:', 'tags': '', 'url': 'Task2.html'}]};